function displayItem(item) {
    const feed = document.getElementById('newsfeed');
    feed.innerHTML += `
        <div class='feeditem'>
            <h5>${item.title}</h5>
            <img src='${item.imageUrl}' alt="${item.title}" class="feedimage"> </img>
            <p>${item.body}</p>
            <a href="${item.linkUrl}" target="_blank">Click this to Read More</a>
        </div>
    `;
}
